Walrus blobs are represented as Sui objects of type Blob. A blob is first registered, indicating that the storage nodes should expect slivers from a Blob ID to be stored. Then a blob is certified, indicating that a sufficient number of slivers have been stored to guarantee the blob's availability. When a blob is certified, its certified_epoch field contains the epoch in which it was certified. A Blob object is always associated with a Storage object, reserving enough space for a long enough period for the blob's storage. A certified blob is available for the period the underlying storage resource guarantees storage. Concretely, Blob and Storage objects have the following fields, which can be read through the Sui SDKs: /// Reservation for storage for a given period, which is inclusive start, exclusive end.
public struct Storage has key, store { id: UID, start_epoch: u32, end_epoch: u32, storage_size: u64,
} /// The blob structure represents a blob that has been registered to with some storage,
/// and then may eventually be certified as being available in the system.
public struct Blob has key, store { id: UID, registered_epoch: u32, blob_id: u256, size: u64, encoding_type: u8, // Stores the epoch first certified if any. certified_epoch: option::Option<u32>, storage: Storage, // Marks if this blob can be deleted. deletable: bool,
} Public functions associated with these objects can be found in the respective storage_resource move module and blob move module . Storage resources can be split and merged in time and data capacity, and can be transferred between users allowing complex contracts to be created.

