You can interact with the daemon through simple HTTP PUT requests. For example, with cURL , you can store blobs using a publisher or daemon as follows: # store the string `some string` for 1 storage epoch
curl -X PUT "$PUBLISHER/v1/blobs" -d "some string"
# store file `some/file` for 5 storage epochs
curl -X PUT "$PUBLISHER/v1/blobs?epochs=5" --upload-file "some/file"
# store file `some/file` and send the blob object to $ADDRESS
curl -X PUT "$PUBLISHER/v1/blobs?send_object_to=$ADDRESS" --upload-file "some/file"
# store file `some/file` as a deletable blob, instead of a permanent one and send the blob object to $ADDRESS
curl -X PUT "$PUBLISHER/v1/blobs?deletable=true&send_object_to=$ADDRESS" --upload-file "some/file" The store HTTP API end points return information about the blob stored in JSON format. When a blob is stored for the first time, a newlyCreated field contains information about the new blob: $ curl -X PUT "$PUBLISHER/v1/blobs" -d "some other string"
{ "newlyCreated": { "blobObject": { "id": "0xe91eee8c5b6f35b9a250cfc29e30f0d9e5463a21fd8d1ddb0fc22d44db4eac50", "registeredEpoch": 34, "blobId": "M4hsZGQ1oCktdzegB6HnI6Mi28S2nqOPHxK-W7_4BUk", "size": 17, "encodingType": "RS2", "certifiedEpoch": 34, "storage": { "id": "0x4748cd83217b5ce7aa77e7f1ad6fc5f7f694e26a157381b9391ac65c47815faf", "startEpoch": 34, "endEpoch": 35, "storageSize": 66034000 }, "deletable": false }, "resourceOperation": { "registerFromScratch": { "encodedLength": 66034000, "epochsAhead": 1 } }, "cost": 132300 }
} The information returned is the content of the Sui blob object . When the publisher finds a certified blob with the same blob ID and a sufficient validity period, it returns a alreadyCertified JSON structure: $ curl -X PUT "$PUBLISHER/v1/blobs" -d "some other string"
{ "alreadyCertified": { "blobId": "M4hsZGQ1oCktdzegB6HnI6Mi28S2nqOPHxK-W7_4BUk", "event": { "txDigest": "4XQHFa9S324wTzYHF3vsBSwpUZuLpmwTHYMFv9nsttSs", "eventSeq": "0" }, "endEpoch": 35 }
} The field event returns the Sui event ID that can be used to find the transaction that created the Sui Blob object on the Sui explorer or using a Sui SDK.
